     "html": "<p></p><h4 style=\"text-align:Right\">\nUCSD Project 802055</h4><p></p>\n\n<p></p><h4 style=\"text-align:Right\">\nAdult Consent</h4><p></p>\n\n\n\n<p><br /></p><h3 style=\"text-align:center\"> <b>University of Minnesota</b></h3><p></p>\n\n<p></p><h3 style=\"text-align:center\"> <b>Consent to Act as a Research Subject and Parent Consent for a Child to Act as a Research Subject</b></h3> <p></p>\n\n<p></p><h4 style=\"text-align:center\"><b>\nThe HEALthy Brain and Child Development (HBCD) Pilot Study</b></h4><p></p>\n\n<p><br /></p><h4 style=\"text-align:left\"><b><i>Introduction</i></b></h4><p></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Dr. Sylia Wilson, Dr. Anna Zilverstand and Dr. Michael Georgieff are conducting this research at University of Minnesota, and are asking for your consent for you and your child to participate. The purpose is to help find out if the planned study activities are acceptable and can be completed by future participants. This pilot study will recruit between 10 and 31 pilot participants at each of 25 locations across the United States where the main study will also be done. This section provides a summary of important information. The rest of the form provides additional details. </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The purpose of this pilot study is to inform a nation-wide research project that is intended to learn how children grow and change (develop) early in life. We will study children’s thinking, behavior, social interactions, emotions, and brains from birth through 10 years old. The research will look at many factors that might be helpful or harmful to a child’s development. These include exposure to tobacco, alcohol, and other drugs before birth, family members’ mental health and stress, the family’s social and economic environment, the child’s exposure to toxins, and how the parent or caregiver interacts with their child. The overall goal of this study is to better understand how children grow up in different environments. While there is no direct benefit to you from participating, the results of this study may help scientists design new methods for improving the lives of children and their families. </p>"
    },
    {
     "type": "text",
     "name": "globalID",
     "visible": false,
     "width": "550px",
     "minWidth": "550px",
     "maxWidth": "550px",
     "title": "globalID",
     "surveyVariable": "ParticipantVariable:globalId"
    }
   ],
   "visibleIf": "{fromInternal} = 'Yes'"
