     "name": "question17",
     "width": "600px",
     "minWidth": "600px",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:16px\">Organizations that may inspect and copy your information include the University of Minnesota Institutional Review Board (IRB) which is a committee that provides ethical and regulatory oversight of research, and other representatives of the University of Minnesota, including those that have responsibilities for monitoring or ensuring compliance, such as the Quality Assurance Program of the Human Research Protection Program (HRPP).</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">We are committed to respecting your privacy and keeping your personal information confidential. When choosing to take part in this study, you are giving us permission to use your personal health information that includes health information in your medical records and information that can identify you. For example, personal health information may include your name, address, phone number or social security number. Those persons who get your health information may not be required by Federal privacy laws (such as the Privacy Rule or what you may know as “HIPAA”) to protect it. Some of those persons may be able to share your information with others without your separate permission. Please read the separate HIPAA Authorization form that we have provided and discussed.</p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The results of this study may also be used for teaching, publications, or for presentation at scientific meetings.</p>"
    }
