     "html": "<p style=\"text-align:left;color:black;font-size:16px;margin:0\">Human Research Protections Program <span style=\"float:right\">University of Minnesota</span></p>\n\n<p style=\"text-align:left;color:black;font-size:16px;margin:0\">(612) 636-5654<span style=\"float:right\">350-2 McNamara</span> </p>\n\n<p style=\"text-align:right;color:black;font-size:16px;margin:0px\"> 200 Oak St SE</p>\n\n<p style=\"text-align:right;color:black;font-size:16px\">Minneapolis, MN 55414</p>\n\n<br /><p style=\"text-align:center;color:black;font-size:20px\"><b>\nEXPERIMENTAL SUBJECT’S BILL OF RIGHTS</b></p>\n\n<br /><p style=\"text-align:left;color:black;font-size:16px\">The faculty and staff of the University of Minnesota wish you to know: </p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Any person who is requested to consent to participate as a subject in a research study involving a medical experiment, or who is requested to consent on behalf of another, has the right to: </p>\n\n<ol style=\"font-size:16px;color:black\">\n<li>Be informed of the nature and purpose of the experiment.</li>\n\n<li>Be given an explanation of the procedures to be followed in the medical experiment, and any drug or device to be used.</li>\n\n<li>Be given a description of any attendant discomforts and risks reasonably to be expected from the experiment.</li>\n\n<li>Be given an explanation of any benefits to the subject reasonably to be expected from the experiment, if applicable.</li>\n\n<li>Be given a disclosure of any appropriate alternative procedures, drugs, or devices that might be advantageous to the subject, and their relative risks and benefits.</li>\n\n<li>Be informed of the avenues of medical treatment, if any, available to the subject after the experiment if complications should arise.</li>\n\n<li>Be given an opportunity to ask any questions concerning the experiment or the procedures involved.</li>\n\n<li>Be instructed that consent to participate in the medical experiment may be withdrawn at any time, and the subject may discontinue participation in the medical experiment without prejudice.</li>\n\n<li>Be given a copy of a signed and dated written consent form when one is required.</li>\n\n<li>Be given the opportunity to decide to consent or not to consent to a medical experiment without the intervention of any element of force, fraud, deceit, duress, coercion, or undue influence on the subject’s decision.</li>\n</ol>\n\n<p style=\"text-align:left;color:black;font-size:16px\">If you have questions regarding a research study, the researcher or his/her assistant will be glad to answer them. You may seek information from the Human Research Protections Program - established for the protection of volunteers in research projects - by calling (612) 626-5654 from 8:00AM to 4:30PM, Monday through Friday, or by writing to the above address.</p>\n\n\n"
    }
