    {
     "type": "html",
     "name": "question5",
     "maxWidth": "600px",
     "html": "<h3 style=\"text-align:center\"> UNIVERSITY OF MINNESOTA</h3> \n\n<h3 style=\"text-align:center\"> <b>PERMISSION TO USE HEALTH INFORMATION FOR RESEARCH HIPAA<sup>1</sup> AUTHORIZATION FORM</b></h3> \n\n<hr style=\"border:2px solid black\" />\n\n<p><br /></p><h4 style=\"text-align:left;margin-left:15%\">\nIRB Study Number: STUDY00015453</h4>\n\n\n<h4 style=\"text-align:left;margin-left:15%\">\nStudy Title: Healthy Brain and Child Development National Consortium</h4>\n\n<h4 style=\"text-align:left;margin-left:15%\">\nPrincipal Investigator Name: Sylia Wilson, PhD</h4>\n\n<h4 style=\"text-align:left;margin-left:15%\">\nPrincipal Investigator Mailing Address: 2025 E River Pkwy, Minneapolis, MN 55414</h4>\n\n<p><br /></p><h4 style=\"text-align:left\"><b>A. What is the purpose of this form?</b></h4><p></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The purpose of this form is to give your permission to us to use and share your health information for the research study listed above, and if we need your medical records, to give your permission to health care providers who are treating you to share your medical records with us for research. Your information may then be used by the research team for the research described in the Consent Form, and may also be shared by the research team with others, including those who support the research, have oversight over the research, or sponsor the research, as explained below. This form also describes the type of health information that will be used for the research. If you decide to give your permission and to participate in the research, you must sign this form and the Consent Form. You should be aware that once your health information is shared with others as described in this form, it may not be protected by privacy laws, and might be shared with others beyond those described in this form or the Consent Form.</p>"
    },
    {
     "type": "html",
     "name": "question7",
     "maxWidth": "600px",
     "html": "<p><br /></p><h4 style=\"text-align:Leftt\">\n<sup>1</sup> HIPAA is the Health Insurance Portability and Accountability Act of 1996, a federal law related to privacy of health information.</h4><p></p>"
    },
