     "html": "<p><br /></p><h4 style=\"text-align:left\"><b>B. What health information will be made available?</b></h4><p></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Health information about you to be used and shared for the research includes those items checked by the research team below:</p>"
