     "html": "<p><br /></p><h4 style=\"text-align:left\"><b>C. What about more sensitive health information?</b></h4><p></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Some health information is so sensitive that it requires your specific permission.  If the research study you are participating in requires any of this sensitive information, the boxes below will be marked and you will be asked to initial to permit the information to be made available to the research team to use and share as described in the Consent Form.</p>"
