     "type": "html",
     "name": "question69",
     "maxWidth": "600px",
     "html": "<p><br /></p><h4 style=\"text-align:left\"><b>D. Who will access and use my health information?</b></h4><p></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">If you agree to participate in this research, your health information will be shared with:<br />\n\n</p><ol style=\"color:black;font-size:16px\">\n<li style=\"padding-bottom:10px\">The research team conducting \nthe research described in the Consent Form, including any collaborating or affiliated research institutions involved  in conducting the research described in the Consent Form;</li>\n<li style=\"padding-bottom:10px\">Others at the University of Minnesota and M Health/Fairview who provide support for the research or who oversee research (such as the Institutional Review Board or IRB which is the committee that provides ethical and regulatory oversight of research at the University, systems administrators  and other technical and/or  administrative support personnel, compliance and audit professionals, individuals involved in processing any compensation you may receive for your participation, and others);</li>\n<li style=\"padding-bottom:10px\">The research sponsor(s), any affiliates, partners or agents of the sponsor(s) involved in the research, organizations funding the research, and any affiliates, partners or agents of the funding organization(s) involved in the research; </li>\n<li style=\"padding-bottom:10px\">Organizations who  provide accreditation and oversight  for the research team, and others who are authorized by law to review the quality and safety of the research (such as U.S. government agencies  like  the Food and Drug Administration, the Office of Human Research Protections, the Office of Research Integrity, or government agencies in other countries); and</li>\n<li style=\"padding-bottom:10px\">Organizations that process any payments that may be made to you for participating in this study and any other individuals or organizations identified in the Consent Form.</li>\n</ol>\n"
    },
    {
     "type": "html",
     "name": "question70",
     "maxWidth": "600px",
     "html": "<p style=\"text-align:left;color:black;font-size:14px;margin:0\">FORM: OGSC-SC284</p>\n\n<p style=\"text-align:left;color:black;font-size:14px;margin:0\">Form Date:  07.18.16</p>\n\n<p style=\"text-align:left;color:black;font-size:14px;margin:0\">Form Revision Date: 05.13.21</p>"
