    {
     "type": "html",
     "name": "question14",
     "maxWidth": "600px",
     "html": "\n<p><br /></p><h4 style=\"text-align:left\"><b>E. Am I required to sign this form?</b></h4><p></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">No, you are not required to sign this form. However, if you do not sign this form, you will not be able to participate in this research study.  Treatment available outside of the study, payment for such treatment, enrollment in health insurance plans and eligibility for benefits will not be impacted by your decision about signing this form.\n</p>\n\n<p><br /></p><h4 style=\"text-align:left\"><b>F. Will I be able to look at my records?</b></h4><p></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">It is possible that the research team may not allow  you to see the information collected for this research study.  However, you may access any information placed in your medical records after the study is complete.\n</p>\n\n<p><br /></p><h4 style=\"text-align:left\"><b>G. Optional research activity</b></h4><p></p>\n\n<p style=\"text-align:left;color:black;font-size:16px\">The  research study that  you are participating might have  optional research activities associated with it, meaning that  you do not  have to agree to these activities in order to participate in the research study. Please indicate your willingness to participate in these optional activities and authorize use of your information from these optional activities as described below by placing your initials next to each activity.\n</p>"
    },
    {
     "type": "matrix",
     "name": "question72",
     "maxWidth": "600px",
     "titleLocation": "hidden",
     "columns": [
      {
       "value": "Column 1",
