    {
     "type": "html",
     "name": "question40",
     "maxWidth": "600px",
     "html": "<p><br /></p><h4 style=\"text-align:left\"><b>H. Does my permission for making my health information available for use and sharing ever expire?</b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px;padding-bottom:10px\">No, there is no expiration date.</p>\n\n<h4 style=\"text-align:left\"><b>I. May I cancel my permission for making my health information available for use and sharing?</b></h4>\n\n<p style=\"text-align:left;color:black;font-size:16px\">Yes. You may cancel your permission at any time by writing to the researcher at the address at the top of this form.  If you cancel your permission, you will no longer be in the research study.  You may want to ask someone on the research team if canceling will affect any  research related medical treatment.   If you cancel your permission, any health information about you that was already used and shared may continue to be used for the research study and any optional elements to the study to which you agreed above.</p>\n"
    },
