hould limit  the amount of health information in your unsecured emails to us to the minimum necessary.</p>\n\n<p style=\"font-size:16px;color:black\"><b>5. Ending Unsecured Email Communication.</b> This  authorization does not have an  expiration date. We may discontinue using unsecured emails as a means of communication with you by notifying you by unsecured email or letter. You  may discontinue using unsecured  emails as a means of communication by  notifying us by e-mail  to privacy@umn.edu or by letter to:</p>\n\n<p style=\"font-size:16px;color:black;margin:0;padding-left:50px\">Health Information Privacy &amp; Compliance Office</p>\n\n<p style=\"font-size:16px;color:black;margin:0;padding-left:50px\">410 ChRC (MMC 501) </p>\n\n<p style=\"font-size:16px;color:black;margin:0;padding-left:50px\">426 Church Street SE</p>\n\n<p style=\"font-size:16px;color:black;margin:0;padding-left:50px\">Minneapolis, MN 55455. </p>\n\n<p style=\"font-size:16px;color:black;padding-top:10px\"><b>6. Scope.</b> I intend for this consent to apply to the following (check the box that applies):</p>"
