     "html": "<hr style=\"border:2px solid black\" />\n\n<p style=\"font-size:32px;color:black;margin:0\"><b>8</b></p>\n\n\n<p style=\"font-size:16px;color:black\">I understand that by signing this form, I am requesting that the health information specified in Section 5 be sent to the third party named in section 4.</p>\n\n<p style=\"font-size:16px;color:black\">I may stop this consent at any time by writing to the organization(s), facility(ies) and/or professional(s) named in section 3.</p>\n\n<p style=\"font-size:16px;color:black\">If the organization, facility or professional named in section 3 has already released health information based on my consent, my request to stop will not work for that health information.</p>\n\n<p style=\"font-size:16px;color:black\">I understand that when the health information specified in section 5 is sent to the third party named in section 4, the information could be re-disclosed by the third party that receives it and may no longer be protected by federal or state privacy laws.</p>\n\n<p style=\"font-size:16px;color:black\">I understand that if the organization named in section 4 is a health care provider they will not condition treatment, payment, enrollment or eligibility for benefits on whether I sign the consent form.</p>\n\n<p style=\"font-size:16px;color:black\">If I choose not to sign this form and the organization named in section 4 is an insurance company, my failure to sign will not impact my treatment; I may not be able to get new or different insurance; and/or I may not be able to get insurance payment for my care.</p>\n\n<p style=\"font-size:20px;color:black\"><b>This consent will end one year from the date the form is signed unless I indicate an earlier date or event here:</b></p>"
