     "name": "question14",
     "maxWidth": "600px",
     "html": "<p><br /></p><h4 style=\"text-align:left\"><b>G. Optional research activity</b></h4><p></p>\n\n<p style=\"text-align:left;color:black;font-size:16px;padding-bottom:100px\">The  research study that  you are participating might have  optional research activities associated with it, meaning that  you do not  have to agree to these activities in order to participate in the research study. Please indicate your willingness to participate in these optional activities and authorize use of your information from these optional activities as described below by placing your initials next to each activity.\n</p>"
