     "rows": [
      {
       "value": "Row 1",
       "text": "The investigator may audio or video record me to aid with data analysis. The investigator will not share these recordings with anyone outside of the immediate study steam."
      },
      {
       "value": "Row 2",
       "text": "The investigator may audio or video record me for use in scholarly presentations or publications. The investigator will share these recordings broadly for these purposes and my identity may be shared as part of this activity."
      },
      {
       "value": "Row 3",
       "text": "The investigator for this research may contact me in the future to see whether I am interested in participating in other research studies by the investigator."
      }
